import React from 'react'
const registerdata = [
   {
     id: "1",
     name: "khushal",
     email: "kk@gmail.com",
     password: "1234",
   },
   {
     id: "2",
     name: "khush",
     email: "kk1@gmail.com",
     password: "1235",
   },
 ];
const UserRegisterContex =  React.createContext({
  registerdata:registerdata,
});

export default UserRegisterContex;
